                  <!-- üí° üáªüá≥ Hi·ªÉn th·ªã m√°y lo·∫°i 40 b·∫±ng h√¨nh elip: th·ªÉ hi·ªán hi·ªáu su·∫•t
                      üáØüáµ „Çø„Ç§„Éó40„ÅÆÊ©üÊ¢∞„ÅØÊ•ïÂÜÜ„ÅßÊèèÁîª„Åó„ÄÅ„Éë„Éï„Ç©„Éº„Éû„É≥„Çπ„ÇíËâ≤„ÅßË°®Áèæ -->

                        <ellipse [pTooltip]="'„É©„Ç§„É≥Áï™Âè∑: ' + machine.line_no +
                                            '\nÂìÅÁï™: ' + machine.parts_name +
                                            '\nË®≠ÂÇôÂÅúÊ≠¢\nFrom date: ' + machine.schedule_stop_machine?.date_start +

                        />
                        <text [pTooltip]="'„É©„Ç§„É≥Áï™Âè∑: ' + machine.line_no +
                                            '\nÂìÅÁï™: ' + machine.parts_name +
                                            '\nË®≠ÂÇôÂÅúÊ≠¢\nFrom date: ' + machine.schedule_stop_machine?.date_start + 
                                            '\nTo date: ' + machine.schedule_stop_machine?.date_end +

                        <!-- {{ machine.schedule_stop_machine? 'Stop':Math.floor((machine.performance ?? 0) * 100)}} -->
